import React from "react";
import Chart from "../Chart/Chart";

const ExpenseChart = (props) => {
  //console.log(props.items);
  // console.log(props.filteredItems);

  var dataChart = [
    { label: "Gen", value: 0 },
    { label: "Feb", value: 0 },
    { label: "Mar", value: 0 },
    { label: "Apr", value: 0 },
    { label: "Mag", value: 0 },
    { label: "Giu", value: 0 },
    { label: "Lug", value: 0 },
    { label: "Ago", value: 0 },
    { label: "Set", value: 0 },
    { label: "Ott", value: 0 },
    { label: "Nov", value: 0 },
    { label: "Dic", value: 0 },
  ];

  for (let item in dataChart) {
    const monthChart = item.date.getMonth();
    dataChart[monthChart].value += item.price;

    console.log(dataChart);
  }



  return <Chart />;
};

export default ExpenseChart;
